import React, { useState } from "react";
import cl from "./RightMenu.module.css";
import { Link } from "react-router-dom";

const RightMenu = ({ basket, setModal }) => {

    const [dropdownCatalog, setDropdownCatalog] = useState('0')
    const [dropdownServices, setDropdownServices] = useState('0')


    function dropdown() {
        if (dropdownCatalog === '0' && dropdownServices === '130px') {
           setDropdownCatalog('350px')
        } 
        else if (dropdownCatalog === '0' && dropdownServices === '0') {
            setDropdownCatalog('220px')
        }
        else {
            setDropdownCatalog('0')
        }
        // else if (drop) {
        //    setDropdownCatalog('0');
        // }
    }

    function dropdownService() {
        if (dropdownServices === '0') {
            setDropdownServices('130px')
            setDropdownCatalog('350px')
        } else {
            setDropdownCatalog('220px')
            setDropdownServices('0')
        }
    }

    function openCatalog (e) {
      e.preventDefault()
      dropdown()
    }
    function openServices (e) {
      e.preventDefault()
      dropdownService()
    }

  return (
    <div>
      <div className={cl.menuTitle}>
        <h3>Меню</h3>
      </div>
      <div className={cl.menuListBody}>
        <ul className={cl.menuList}>
          <li className={cl.menuListItem}>
            <Link href="" onClick={() => {setModal(false)}}>
              <a><span className={cl.menuListItemLink}>Главная</span></a>
            </Link>
          </li>
          <li className={cl.menuListItem}>
            <Link href="/about" className={cl.menuListItemLink} onClick={() => {setModal(false)}}>
              О нас
            </Link>
          </li>
          <li className={cl.menuListItem}>
            <Link href="/catalog" className={cl.menuListItemLink} onClick={() => {setModal(false)}}>
              Продукция
              <i onClick={openCatalog }
                        className="fas fa-chevron-down"
                        style={{
                          marginLeft: "5px",
                          position: "relative",
                          right: -10,
                          top: 2,
                        }}
                        aria-hidden="true"
                      ></i>
            </Link>
            <ul className={cl.menuCatalog} style={{height: dropdownCatalog}} onClick={(e) => {e.stopPropagation()}}>
                <li className={cl.menuCatalogItem}>
                    <Link href="" className={cl.menuCatalogItemLink} onClick={() => {setModal(false)}}>
                      Экструзированные корма
                    </Link>
                </li>
                <li className={cl.menuCatalogItem}>
                    <Link href="" className={cl.menuCatalogItemLink} onClick={() => {setModal(false)}}>
                      Удобрения
                    </Link>
                </li>
                <li className={cl.menuCatalogItem}>
                    <Link href="" className={cl.menuCatalogItemLink} onClick={() => {setModal(false)}}>
                      Сельскохозяйственная техника
                    </Link>
                </li>
                <li className={cl.menuCatalogItem}>
                    <Link href="" className={cl.menuCatalogItemLink} onClick={() => {setModal(false)}}>
                      Запчасти для сельхоз. техники
                    </Link>
                </li>
                <li className={cl.menuCatalogItem}>
                    <Link href="" className={cl.menuCatalogItemLink} onClick={() => {setModal(false)}}>
                      Услуги
                      <i onClick={openServices}
                    className="fas fa-chevron-down"
                    style={{
                      marginLeft: "5px",
                      position: "relative",
                      right: -10,
                      top: 2,
                    }}
                    aria-hidden="true"
                  ></i>
                    </Link>
                    <ul className={cl.menuServices} style={{height: dropdownServices}} onClick={(e) => {e.stopPropagation()}}>
                        <li className={cl.menuServicesItem}>
                            <Link href="" className={cl.menuServicesItemLink} onClick={() => {setModal(false)}}>
                            Экструзированные корма
                            </Link>
                        </li>
                        <li className={cl.menuServicesItem}>
                            <Link href="" className={cl.menuServicesItemLink} onClick={() => {setModal(false)}}>
                            Удобрения
                            </Link>
                        </li>
                        <li className={cl.menuServicesItem}>
                            <Link href="" className={cl.menuServicesItemLink} onClick={() => {setModal(false)}}>
                            Сельскохозяйственная техника
                            </Link>
                        </li>
                    </ul>
                </li>
            </ul>

          </li>
          <li className={cl.menuListItem}>
            <Link href="" className={cl.menuListItemLink} onClick={() => {setModal(false)}}>
              Контакты
            </Link>
          </li>

        </ul>
      </div>
    </div>
  );
};

export default RightMenu;
